import React, { useState } from 'react';

// import NewExpense from './components/NewExpense/NewExpense';
import Gondula from './components/Gondula/Gondula';

const App = () => {

  const [planograms, setPlanograms] = useState([])
  const gondula = [
    {
      id: 'e1',
      title: 'Paper',
      amount: 94.12,
      product: new Date(2020, 7, 14),
    },
    { id: 'e2',
      title: 'New TV', 
      amount: 799.49, 
      product: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      product: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      product: new Date(2021, 5, 12),
    },
  ];

  function fetchPlanogramHandler() {
    fetch('https://apiserver.sungalcorp.synology.me/dbGet_planogram?filter=storeID=7').then(response => {
      return response.json();
    }).then(data => {
      const transformedPlanogram = data.results.map(planogramData => {
        return { 
          gondula: planogramData.gondula,
          shelf: planogramData.shelf,
          facing: planogramData.facing,
          upc: planogramData.upc
        };
      });
      setPlanograms(transformedPlanogram);
    });
  }

  const addExpenseHandler = expense => {
    console.log('In App.js');
    console.log(expense);
  };

  // return React.createElement(
  //   'div',
  //   {},
  //   React.createElement('h2', {}, "Let's get started!"),
  //   React.createElement(Expenses, { items: expenses })
  // );

  return (
    <div>
      <Gondula items={gondula} />
    </div>
  );
}

export default App;
